import React, { useEffect, useState } from "react";
import "./Home.css";
import axios from "axios";

function Home() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    dataReceived();
  }, []);

  const dataReceived = async () => {
    const data = await axios.get("http://localhost:3003/users");
    setUsers({ data });
    console.log(data);
  };

  return (
    <div className="home_main_body">
      <div className="table_main_body">
        <table>
          <tr>
            <th>User</th>
            <th>Password</th>
            <th>Email</th>
            <th>Address</th>
            <th>Action</th>
          </tr>

          <tr>
            <td>Vivek</td>
            <td>password</td>
            <td>abz@f.com</td>
            <td>Mohali</td>
            <td>
              <div className="home_button">
                <div className="login_button">
                  <button className="button1">View</button>
                </div>

                <div className="login_button">
                  <button className="button2">Delete</button>
                </div>
                <div className="login_button">
                  <button className="button3">Update</button>
                </div>
              </div>
            </td>
          </tr>
        </table>
      </div>
    </div>
  );
}

export default Home;
